import React from 'react'


import Styled from 'styled-components'
const Sidebar=()=> {
  return (
    <SidebarContainer>
        <Menu>
            <a >
                <h2>Dashboard</h2>
            </a>
            <a>
                Clients
            </a>
            <a>
                Bodyguard
            </a>
            <a>
                Team
            </a>
            <a>
                Settings
            </a>
            <a>
                Another
            </a>
            
        </Menu>
       
          <Logout>
                <p>
                Logout
                </p>
          </Logout>
        

    </SidebarContainer>
  )
}

export default Sidebar;

const SidebarContainer = Styled.div`
    display:flex;
    flex-direction: column;
    justify-content: flex-end;
    background:white;
    width:250px;
    top: 100px;
    left:0;
    bottom:0;
    
    border: 1px solid black;


`
const Menu = Styled.div`
display:flex;
justify-content:space-between;
align-items:start;
flex-direction:column;
margin-bottom: 2rem;
padding: 5px;
left:0;
margin-left: 3rem;


`
const Logout = Styled.div`

position:relative;
font-weight:400;
bottom:0;



`
